import React from "react";
import './Feed.css';
import { HeaderData, TweetData } from "../../types/Models";

interface FeedProps {
    headerData: HeaderData;
    tweetThreads: TweetData[][];
}

interface HeaderProps {
    headerData: HeaderData;
}

const Feed: React.FC<FeedProps> = ({headerData, tweetThreads}) => {
    return(
        <div className="feed">
            <Header />
        </div>
    )
}

const Header: React.FC<HeaderProps> = ({headerData}) => {
    return (
        <div>
        <h3 className="home-text">Home</h3>
        <div className="header-btns">
            <div className="for-you">
                <h5>For you</h5>
            </div>
            <div className="following">
                <h5>Following</h5>
            </div>
        </div>
        </div>
    )
}

const TweetPost: React.FC = () => {
    return (
        <>
        </>
    )
}

const TweetList: React.FC = () => {
    return (
        <>
        </>
    )
}

const Tweet: React.FC = () => {
    return (
        <>
        </>
    )
}

export default Feed;
